import React, { Component } from 'react'
import { Button } from 'reactstrap';

export default class About extends Component {
    constructor(){
        super()
        console.log("i am cosntructor");
        this.state={
            name:'satyam'
        }
    }

    componentDidMount=()=>{
        console.log("i am componentDid mount",this.props.name);
        console.log("i am componentDid mount",this.props.age);
    }
    componentDidUpdate=()=>{
        console.log("i am component did update");
    }
  render() {
    return (
      <div>
          <h1>i am just test purpose</h1>
          {this.state.name}
          <hr/>
          <Button onClick={()=>{
              this.setState({name:'satyam sahu'});
          }}>click me</Button>
      </div>
    )
  }
}
